import styled from "styled-components";

import Header from "../Header";

const StyledOnline = styled.div`
  width: 100%;
`;

const OnlineP = styled.p`
  font-size: 16px;
  font-weight: 700;
`;

const Online = ({}) => {
  return (
    <StyledOnline>
      <Header>
        <OnlineP>ONLINE (7)</OnlineP>
      </Header>
    </StyledOnline>
  );
};

export default Online;
